import React from "react";
import { SafeAreaView, TextInput } from "react-native";

export default function Signup(props) {

    return (
        <SafeAreaView>
            <TextInput
            style = {styles.input}
                placeholder="Correo"
            />
        </SafeAreaView>
    )


}
const styles = StyleSheet.create({
    input :{
        margin: 3
    }

})
